workflows:
  default-workflow:
    name: Default Workflow
    max_build_duration: 60
    environment:
      vars:
        ENV: Encrypted()
        GOOGLE: Encrypted()
        FIREBASE_TOKEN: Encrypted()
        FCI_KEYSTORE_PATH: /tmp/keystore.keystore
        FCI_KEYSTORE: Encrypted()
        FCI_KEYSTORE_PASSWORD: Encrypted(Z0FBQUFBQmg2dndvSlRXWEYtWkJnQWtGNF9kN2RpTzVZREFHOTRTWE9pMXVOcmkxNnNadmpDZlNwUmI5N3ZtdlRjYjBBMWhKVEpPUldJZWlfeFpMWUhjX2dzRk1ialliNFE9PQ==)
        FCI_KEY_PASSWORD: Encrypted(Z0FBQUFBQmg2dndvcmRKbk9pUkFmN1I3QkxXU05XeWdqbmV1Q183Vm03TEtJYWRWX0RTTTJWTW1LRUpqbUpoa3JpUUVYdGwwWGlILVkxdlhWWGNGWVZ3TEE0UnEzcWJRY0E9PQ==)
        FCI_KEY_ALIAS: Encrypted(Z0FBQUFBQmg2dndvSHAwOHNnVGtDOEF1NFF5Q01UbkkydkZfWjNTdXQxZllqMFVBR0EteHNGY09GNHZVN3FQWnpXUS1neUxaejlJSVVLdHlnaWhfdDd3c3l2b1BDRHViQXc9PQ==)
        PROVISIONING_PROFILE: Encrypted()
        CERTIFICATE: Encrypted()
        CERTIFICATE_PASSWORD: Encrypted(Z0FBQUFBQmg2dndvUGswMmxHRHhoWmJyT2JlVG5ZVmF0SVFYY3ZFV3JLSzdybnFCa1Y2VG5iMXJFUlRtUksyaUNzNGNhVHIzcG5KRXAySVBJZTB0d25uVUdMWmlnbUhrMHZoT0trOTRtQm4yOV9oeDZnTGFqclE9)
      flutter: 2.8.1
      xcode: '13.2'
      cocoapods: 1.11.2
    triggering:
      events:
        - push
      branch_patterns:
        - pattern: develop
          include: true
          source: false
        - pattern: master
          include: false
          source: false
      tag_patterns:
        - pattern: '*'
          include: true
    scripts:
      - |
        # set up key.properties
        echo $FCI_KEYSTORE | base64 --decode > $FCI_KEYSTORE_PATH
        cat >> "$FCI_BUILD_DIR/android/key.properties" <<EOF
        storePassword=$FCI_KEYSTORE_PASSWORD
        keyPassword=$FCI_KEY_PASSWORD
        keyAlias=$FCI_KEY_ALIAS
        storeFile=/tmp/keystore.keystore
        EOF
      - |
        # set up local properties
        echo "flutter.sdk=$HOME/programs/flutter" > "$FCI_BUILD_DIR/android/local.properties"
      - flutter packages pub get
      - |
        echo $ENV | base64 --decode > $FCI_BUILD_DIR/.env
        echo $GOOGLE | base64 --decode > $FCI_BUILD_DIR/ios/Runner/output.json
        plutil -convert xml1 $FCI_BUILD_DIR/ios/Runner/output.json -o $FCI_BUILD_DIR/ios/Runner/GoogleService-info.plist
        rm $FCI_BUILD_DIR/ios/Runner/output.json
        cd ios
        rm -rf Podfile.lock
        pod install --repo-update
        ./gradlew assembleDebug
        flutter clean
      - flutter build apk --release -t lib/env/production.dart --verbose
      - find . -name "Podfile" -execdir pod install \;
      - keychain initialize
      - |
        # set up provisioning profiles
        PROFILE_PATH="$(mktemp "$HOME/Library/MobileDevice/Provisioning Profiles"/ios.mobileprovision)"
        echo "$PROVISIONING_PROFILE" | base64 --decode > "$PROFILE_PATH"
        echo "Saved provisioning profile $PROFILE_PATH"
      - |
        # set up ios signing certificate
        echo $CERTIFICATE | base64 --decode > '/tmp/certificate.p12'
        keychain add-certificates --certificate '/tmp/certificate.p12' --certificate-password $CERTIFICATE_PASSWORD
      - xcode-project use-profiles
      - flutter build ipa --export-options-plist=/Users/builder/export_options.plist
        -t lib/env/production.dart --verbose
    artifacts:
      - build/**/outputs/apk/**/*.apk
      - build/**/outputs/bundle/**/*.aab
      - build/**/outputs/**/mapping.txt
      - build/ios/ipa/*.ipa
      - /tmp/xcodebuild_logs/*.log
      - '*.snap'
      - build/windows/**/*.msix
      - flutter_drive.log
    publishing:
      email:
        recipients:
          - jstache@tutanota.com
          - mustache40@gmail.com
      slack:
        channel: '#general'
        notify_on_build_start: true
      firebase:
        firebase_token: $FIREBASE_TOKEN
        ios:
          app_id: 1:493864449137:ios:bf5c6cdc168866d85057d0
          groups:
            - kiatsu
        android:
          app_id: 1:493864449137:android:75b0b25472f222c95057d0
          groups:
            - kiatsu_android
      scripts:
        - "#!/usr/bin/env sh\n \nset -e   # exit on first failed command\nset -x \
          \  # print all executed commands to the log\n \nif [ \"$FCI_BUILD_STEP_STATUS\"\
          \ == \"success\" ]\nthen\n\n  # iOS Firebase App Distribution CLI\n  firebase\
          \ appdistribution:distribute $FCI_BUILD_OUTPUT_DIR/kiatsu.ipa --app 1:493864449137:ios:bf5c6cdc168866d85057d0\
          \ --groups \"kiatsu\" --token \"$FIREBASE_TOKEN\" --release-notes-file \"\
          $FCI_BUILD_DIR/release_notes.txt\"\n\nfi\n"
